/** @jsx jsx */
import { jsx } from 'theme-ui'
import Link from 'next/link'
import { FC, useEffect, useState } from 'react';
import { accountService } from '../_services/index.service';
import { Layout, Menu } from 'antd';
import { Role } from '../_helpers/role';
import { IUser } from '../_models/account.models';
import { useRouter } from 'next/router';

const { Header } = Layout;


const Nav: FC = () => {
    const [user, setUser] = useState<IUser>({} as IUser);
    const [Current, setCurrent] = useState("");
    const router = useRouter();

    useEffect(() => {
        console.log("useEffect");
        const subscription = accountService.user.subscribe(x => setUser(x));
    }, []);

    const handleMenuClick = ({ key }) => {
        console.log("Menu");

        switch (key) {
            case "logout":
                setCurrent(null);
                accountService.logout(router);
                break;
            case "login":
                router.push("/account/login")
                break;
            case "register":
                router.push("/account/register")
                break;
            case "home":
                router.push("/")
                break;
            default:
                router.push(`/${key}`);
                break;
        }
    }

    return (
        <Header style={{ position: 'fixed', zIndex: 1, width: '100%' }}>
            <div className="logo" />
            <Menu onClick={handleMenuClick} theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                <Menu.Item key="home">Home</Menu.Item>
                {
                    (!user) ?
                        <>
                            <Menu.Item key="register">Register</Menu.Item>
                            <Menu.Item key="login">Login</Menu.Item>
                        </> :
                        <>
                            <Menu.Item key="logout">Logout</Menu.Item>
                        </>
                }
                {user &&
                    user.role === Role.Admin &&
                    <Menu.Item key="admin">Admin</Menu.Item>
                }
                {user && <Menu.Item key="profile">Profile</Menu.Item>}
            </Menu>

        </Header>
    )
}

export default Nav
